def allanagrams(s):
	solution = []
	subsets = []
	perm(s, solution, subsets, "")
	#print(subsets)
	print(solution)
	return subsets


def perm(s,solution,subsets, curr):
	if s == "":
		solution.append(curr[:])
	else:
		for i in range(len(s)):
			
			curr += s[i]
			s_copy = s[:i] + s[i+1:]
			subsets.append(curr)
			

			perm(s_copy,solution,subsets,curr)
			s_copy = s[:i] + s[i:]
			curr = curr[:-1]


def isanagram(s1,s2):
	perms = allanagrams(s1)
	if s2 in perms:
		return True
	else:
		return False


